import React from "react";

class Users extends React.Component {
  users = [
    {
        id: 1,
        firstname: "Vadim",
        lastname: "Khakimyanov",
        bio: 'Программист получаеца',
        age: 27,
        isHappy: true
    },
    {
        id: 2,
        firstname: "Ruslan",
        lastname: "Melnikov",
        bio: 'Промоутер получаеца',
        age: 18,
        isHappy: true
  },
  {
    id: 3,
    firstname: "Naruto",
    lastname: "Uzumaki",
    bio: 'Хокаге получаеца',
    age: 33,
    isHappy: false
},
  ]
  render() {
  return (
      <div>
        {this.users.map((e) => (<div>
              <h5>{e.firstname} {e.lastname} (возраст {e.age})</h5>
              <p>{e.bio}</p>  
          </div>))}
      </div>
  )
}
}

export default Users
